import React from 'react';
import './Menu.css'

function Menu() {
  return (
    <nav className="menu">
      <ul className="menu-list">
        <li className="menu-item">
          <a href="/">Início</a>
        </li>
        <li className="menu-item">
          <a href="/mangas">Mangás</a>
        </li>
        <li className="menu-item">
          <a href="/lançamentos">Lançamentos</a>
        </li>
        <li className="menu-item">
          <a href="/gêneros">Gêneros</a>
        </li>
      </ul>
    </nav>
  );
}

export default Menu;
